import React, { useEffect } from "react";
import { Link } from 'react-router-dom';
import CookProfile from '../components/cookProfile';
import './cooks.sass';
import { withRouter } from "react-router"; 
import axios from 'axios';


const Cooks = (props) => {
	const [userData, setUserData] = useState(null);

	useEffect(() => {
		const data = JSON.stringify({authid: props.location.state.authid});

		axios.post('/api/users/get-cook-profile', data, { headers: {'Content-Type': 'application/json'}})
		.then(res => {
			console.log(res.data);
			setUserData(res.data);
		})
		.catch(err => console.log(err));
	},[])

	if (!userData) {
		return null;
	} else {
		return (
			<div id="cookBody">

			</div>
		);
	}
};


export default withRouter(Cooks);
